GettingStartedBrowserSDK.html.body:
Browser SDK - Getting Started
준비사항

node.js
WebServer (Apache server, python SimpleHttpServer, nginx, harp ...)

가장 쉬운 통화앱 개발

먼저 웹서버가 서비스할 디렉토리 하나를 선택하거나 만듭니다.
해당 디렉토리에서 npm install remon-browser-sdk 실행합니다.
index.html 파일을 생성하고 코드를 작성합니다.








    video#remoteVideo { width:auto; height: 80%; background-color: black; }
    button#connectChannelButton { position:absolute; overflow:visible; left:50%; top:10px; }
    html,body { height:100%; }




  let isConnected = false;
  const config = { credential: {
      key: '1234567890', serviceId: 'SERVICEID1'
    },
    view: {
      remote: '#remoteVideo'
    },
  };
  const remon = new Remon({ config:config });

  function start() {
    if (isConnected === false){
      isConnected = true;
      document.getElementById("connectChannelButton").innerHTML = "Close";
      remon.connectChannel("simpleRemon");
    }else{
      isConnected = false;
      document.getElementById("connectChannelButton").innerHTML = "Connect";
      remon.disconnect();
    }
  }

  Remon JS Simple Test



  Connect




이제 이 디렉토리를 웹서버를 통해서 접근할 차례입니다. 예를 들어 harp server를 사용했다고 합시다.
harp server 라고 실행하면 포트 9000번을 통해 접근할 수 있죠.
http://localhost:9000 으로 파이어폭스나 크롬 브라우저를 통해 접근해봅시다. 2개의 탭으로 접근하거나 아예 다른 창으로 각각 'Connect'를 클릭하면?
첫번째 Remon 앱을 만든 것을 축하합니다.

소스를 살펴보기
Config
먼저 설정 객체를 만듭니다.
const config = { credential: {
    key: '1234567890', serviceId: 'SERVICEID1'
  },
  view: {
    remote: '#remoteVideo'
  },
};


key값은 Remote Monster에 회원가입하여 받게 되는 비밀번호입니다. serviceId값은 Remote Monster에 회원가입시 입력한 자신의 서비스 id입니다. 잘 모른다면 credential 객체를 설정 않해도 무방합니다.
view 항목에 보면 video 태그의 id를 설정합니다. 원격에서 상대방의 영상이 수신되면 그 영상을 출력할 video 태그의 id입니다.

만들어둔 설정을 인자로 하여 Remon 객체를 생성 합니다.

const remon = new Remon({ config:config });

Connect
이제 방에 들어갈 시간입니다. connectChannel 메소드는 입력값에 해당하는 방으로 들어가는 명령을 수행합니다.

remon.connectChannel("simpleRemon");

혹은 방에서 나옵니다.

remon.disconnect()
방에 들어가는 명령이 있다면 나오는 명령이 있겠죠. disconnect는 바로 들어갔던 방에서 나오는 명령입니다
이제 모든 것이 끝났습니다. Remote Monster의 Javascript API는 이것만으로도 통신의 모든 것을 완벽히 수행합니다. 물론 더 자세한 조작은 필요하겠죠?

LocalVideo 생성
앞서 예제는 상대편 video만 있어서 연결하기 전에는 나의 얼굴을 확인할 수 없었습니다. 이제 나의 video tag를 삽입하고 그 tag의 id를 RemoteMonster에게 알려줍시다.
html body에 다음과 같이 local Video를 추가합니다.



그리고 config를 다음과 같이 수정합니다.
const config = {
  credential: {
    key: '1234567890', serviceId: 'SERVICEID1'
  },
  view: {
    remote: '#remoteVideo', local:'#localVideo'
  },
};

Callback 이벤트 처리기 사용하기
Remon은 수많은 일들을 내부적으로 Remote Monster의 서버와 작업하게 됩니다. 때로는 네트워크 상황이 안좋아서 연결이 안될 수도 있고 특별한 이벤트는 귀기울여 수신해야할 필요도 있습니다. 때문에 Remon은 콜백 이벤트 처리기, Listener를 제공하여 이를 통해 다양한 정보를 개발자가 얻을 수 있도록 하고 있습니다.
const listener = {
  onInit(token) { ... },
  onCreateChannel(channelId) { ... },
  onConnectChannel(channelId) { ... },
  onComplete() { ... },
  onAddLocalStream(stream) { ... },
  onAddRemoteStream(stream) { ... },
  onStateChange(state) { ... },
  onDisconnectChannel() { ... },
  onMessage(message) { ... },
  onError(error) { ... },
  onStat(result) { ... },
};

위에서 만든 설정과 리스너를 인자로 하여 다시 시작해봅시다.
remon.init({ config:config, listener:listener });
...
remon.connectChannel("simpleRemon");

GettingStartedAndroidSDK.html.body:
Android SDK - Getting Started
준비 사항

안드로이드 스마트폰 2개
Android Studio 개발 환경
롤리팝 이상의 안드로이드 OS

세상에서 가장 쉬운 안드로이드 통화앱 개발

안드로이드에서 Remote Monster를 적용하려면 크게 다음과 같은 순서로 개발이 진행됩니다.
Remote Monster Android SDK download center URL을 프로젝트 build.gradle 등록
모듈 build.gradle에 SDK 다운로드 설정
AndroidMenifest.xml에 권한등의 설정
영상 통화인 경우 layout file에 영상전용 View 등록
Config file 생성
Remon 객체 생성
Remon.connect 실행
Callback 메소드 처리하기


이제 하나씩 따라해봅시다. 예상 소요시간은 약 30분 입니다.

프로젝트 build.gradle에서 repository URL 설정

다음과 같이 Remote Monster가 제공하는 안드로이드 SDK repository URL을 등록합니다.
이 URL을 통해서 이전 버전의 Remote Monster SDK를 다운로드 받을 수도 있습니다.

allprojects {
  repositories {
    jcenter()
    maven {
      url 'https://remotemonster.com/artifactory/libs-release-local'
    }
  }
}

 ❗❗❗만약 빌드시 failed to resolve: com.remon:remondroid:x.x.x와 같은 에러가 나타난다면 여기를 참고하세요 ❗❗❗
 결론적으로 오래된 JDK가 새로운 루트 인증서를 인식 못하는 문제로 최신 JDK로 혹은 JDK 8u101 이상으로 업그레이드하면 됩니다 
module build.gradle을 수정하기

모듈 build.gradle dependencies 항목 마지막 라인에 다음과 같이 한 줄을 추가합니다.

compile(group: 'com.remon', name: 'remondroid', version: '0.0.11')


이제 안드로이드 스튜디오를 동기화하면 자동으로 Remote Monster의 Android SDK인 remondroid를 다운로드 받게 됩니다.

AndroidManifest.xml에 권한 추가

아래와 같이 Remondroid가 동작하기 위해 필요한 권한등을 추가합니다.



















local과 remote view를 layout에 추가

만약 영상통화를 한다면 보통 자신의 화면과 원격의 화면을 동시에 보여주고 싶을 것입니다. 때문에 미리 자신이 원하는 View에 다음과 같이 로컬과 원격의 뷰를 추가합니다. PercentFrameLayout은 동적으로 다양한 비율로 화면 크기와 위치를 조절하는 레이아웃이며 실제 영상을 보여주는 뷰는 SurfaceViewRenderer입니다.








Remon의 Config 객체 생성

이제 코딩의 시간입니다. 먼저 사전에 환경 설정을 할 필요가 있습니다. View가 시작될 때 다음과 같이 Config객체를 생성합니다. Key와 ServiceID는 넣지 않아도 됩니다. 자동으로 테스트용 key와 serviceId로 설정됩니다. 나중에 본격적으로 Remote Monster를 사용하고 싶다면 회원가입을 하고 키를 발급받아서 Config에 입력하면 됩니다.
Config 객체를 통해 다양한 환경 설정을 할 수 있습니다. 여기서는 일단 앞서 설정한 Local, Remote View를 설정하였습니다.
필요에 따라서는 영상통화가 아닌 음성통화만 사용하게 할 수도 있고 코덱을 바꾸거나 해상도를 바꿀 수도 있습니다.

Config config = new com.remon.remondroid.Config();
//config.setKey("1234567890");
//config.setServiceId("SERVICEID1");
config.setLocalView((SurfaceViewRenderer) findViewById(R.id.local_video_view));
config.setRemoteView((SurfaceViewRenderer) findViewById(R.id.remote_video_view));

Remon 객체 생성

이제 Remon 객체를 생성합니다. 주로 View 시작시에 먼저 객체를 생성할 것을 권합니다.
Remon객체 생성시 앞서 설정하였던 Config객체를 인자로 넣어주고 기타 Observer는 그냥 다음에 설명하겠습니다.
Observer는 Callback 클래스인데 굳이 넣고 싶지 않다면 RemonObserver를 new 해도 됩니다.

// create channel
//remon = new Remon(MainActivity.this, config, new MyObserver());
remon = new Remon(MainActivity.this, config, new RemonObserver());

Connect

이제 방을 만들거나 이미 만들어진 방에 들어갈 차례입니다. connect에는 크게 두가지 방식이 있습니다. 방이름을 입력하지 않고 connect명령을 할 경우 RemoteMonster는 임의의 방이름을 생성해서 반환값으로 방이름을 반환합니다. 다음에 그 방으로 입장하고 싶은 이는 그 반환된 값으로 connect할 때 사용하여 connect하면 됩니다. 그렇지 않고 직접 방 이름을 넣어서 방을 생성하거나 방을 접속할 수도 있습니다.

// connect Channel with channel name
remon.connectChannel(“myroom”);

onDestroy 처리

모든 통신이 끝났을 경우 꼭 remon객체를 close해주어야 합니다. close를 통해서 모든 통신자원과 미디어 스트림 자원이 해제됩니다.

remon.close();

권한에 대한 고객 확인창 처리

안드로이드 최신 버전의 경우 앱의 권한에 대해 처음 앱 사용시 사용자에게 직접 묻게 됩니다. 이를 위한 처리도 필요하겠죠.
안드로이드 개발자인 당신이 가장 선호하는 방식으로 이것을 처리하면 됩니다. 처리해야할 권한은 다음과 같습니다.

public static final String[] MANDATORY_PERMISSIONS = {
  "android.permission.INTERNET",
  "android.permission.CAMERA",
  "android.permission.RECORD_AUDIO",
  "android.permission.MODIFY_AUDIO_SETTINGS",
  "android.permission.ACCESS_NETWORK_STATE",
  "android.permission.CHANGE_WIFI_STATE",
  "android.permission.ACCESS_WIFI_STATE",
  "android.permission.READ_PHONE_STATE",
  "android.permission.BLUETOOTH",
  "android.permission.BLUETOOTH_ADMIN",
  "android.permission.WRITE_EXTERNAL_STORAGE"
};

RemonObserver 클래스 생성

Remote Monster를 통해 오고가는 모든 통신과정의 이벤트를 수신할 필요가 있습니다. 이를 위해 RemonObserver에서 상속받은 별도의 Callback 클래스를 만들어봅시다.

public class MyObserver extends RemonObserver {
  @Override
  public void onError(Throwable t) {
    super.onError(t);
  }
}


RemonObserver를 통해 처리하면 좋은 메소드는 다음과 같습니다.
onStateChange: 최초 Remon객체를 만들고 방을 만들며 접속하고 접속에 성공하고 통신을 마칠 때까지의 모든 상태 변화에 대해 처리하는 메소드입니다. RemonState enum객체를 통해 어떤 상태로 변경되었는지를 알려줍니다. RemonState의 상태는 다음과 같습니다.
INIT(시작), WAIT(방 생성), CONNECT(방 접속), COMPLETE(통신 연결완료), FAIL(실패), CLOSE(종료)


onError: 통신 시도 중 장애 발생시 호출됩니다.
onAddLocalStream: 자기 자신의 카메라의 영상이 혹은 음성 스트림을 획득하였을 경우 호출됩니다.
onAddRemoteStream: 상대방의 영상이나 음성 스트림을 획득하였을 경우 호출됩니다. 연결이 되었다는 뜻이죠.

BrowserConfigGuide.html.body:
브라우저 SDK의 Config

RemoteMonster는 객체 생성 전에 config값을 선행적으로 받습니다. 가장 단순하게는const config = {
view: {
  remote: '#remoteVideo', local: '#localVideo',
},
};


와 같이 영상을 출력할 video tag를 설정하는 것만으로 RemoteMonster는 잘 알아듣고 config처리를 합니다. 하지만 실제 서비스를 위해서 RemoteMonster는 더 많은 설정값을 요구합니다. 이를테면 서비스 인증을 위한 키값을 요구합니다.const config = {
credential: {
  key: '1234567890', serviceId: 'SERVICEID1'
},
view: {
  remote: '#remoteVideo', local: '#localVideo',
},
};


위와 같이 config는 view 항목뿐 아니라 credential값을 요구합니다. 이를 통해 실제로 RemoteMonster에 가입 정보를 확인하고 더 나은 서비스를 제공받을 수 있습니다.
key는 RemoteMonster로 부터 발급받는 비밀키입니다. serviceId는 여러분이 RemoteMonster에 서비스 가입을 할 때 입력하는 값입니다. 즉 당신의 id값이라고 보면 됩니다.
이제 이 config에 더하여 음성과 영상에 대한 보다 다양한 옵션을 살펴봅시다.const config = {
credential: {
  key: '1234567890', serviceId: 'SERVICEID1'
},
view: {
  //remote: '#remoteVideo'
},
media: {
  audio: true, video: false,
}
};


이 media옵션 내용은 음성만 사용하겠다는 옵션입니다. 즉 video를 false하면 영상통신을 할 수 없습니다. 매우 많은 RemoteMonster의 서비스들은 음성전용 서비스이기도 합니다.
만약 video를 사용한다면 매우 많은 옵션을 설정할 수 있습니다.video: {
width: {max: '640', min: '640'},
height: {max: '480', min: '480'},
codec: 'H264', // 'VP9' , 'VP8' or 'H264'
frameRate: {max:15, min:15},
facingMode: 'user', // 'user' or 'environment'
}


항목을 하나씩 살펴보겠습니다.
먼저 width와 height는 상대편에게 보낼 영상의 해상도를 결정하는 것입니다. 최대 640 480의 해상도로 보낼 것을 설정하였지만 이것이 꼭 지켜지는 것은 아닙니다. WebRTC는 기본적으로 네트워크나 단말의 상태에 따라 해상도와 framerate등을 유연하게 변화시키면서 품질을 유지하고 있기 때문입니다. 해상도가 실제와 차이가 날 수는 있지만 ratio는 최대한 맞추기 위해 노력합니다.
Browser는 H.264와 VP8, VP9등의 영상 코덱을 지원하고 있습니다. RemoteMonster는 H.264를 기본 코덱으로 사용하고 있으며 변경이 필요하다면 이 설정으로 변경할 수 있습니다.
frameRate항목은 1초에 몇번의 frame으로 인코딩할 지를 결정합니다. 일반적인 영상통화에서는 15정도면 적당하지만 더 촘촘한 framerate를 원한다면 높여줄 수 있겠죠.
facingMode는 기기의 앞과 뒤에 카메라가 있을 때 어떤 쪽의 카메라를 사용할 것인지를 결정하는 것입니다. 현재 모바일 버전의 크롬 브라우저에서는 facingMode가 제대로 동작하지 않습니다.

const config = {
  credential: {
    key: '1234567890', serviceId: 'SERVICEID1'
  },
  view: {
    //blah blah
  },
  media: {
    // blahblah
  },
  dev:{
    logLevel: 'INFO',
  }
};


마지막으로 로그레벨 설정입니다. SILENT, ERROR, WARN, INFO, DEBUG, VERBOSE를 설정할 수 있으며 뒤로 갈 수록 더 자세한 로그를 확인할 수 있습니다.

RemondroidRemon.html.body:
리모트몬스터 안드로이드의 Remon 클래스

Remon클래스는 가장 핵심이 되는 클래스로서 다음과 같은 메소드를 제공합니다.// 생성자
public Remon(Context ctx, Config config, RemonObserver observer)


안드로이드 컨텍스트와 리모트몬스터 Config, 콜백메소드 처리를 위한 Observer를 입력값으로 넣으면 원격의 리모트몬스터 서버와 연결이 됩니다.
연결이 완료되면 Observer의 onInit메소드와 onStateChange메소드가 호출됩니다.
만약 객체가 생성후 바로 상대편과 연결을 하고 싶다면 onInit메소드 때 Remon의 connectChannel 메소드를 호출하면 됩니다.// 방에 통화 연결
public void connectChannel(String channelId)


방에 접속하거나 방을 만드는 명령입니다. 주어진 이름의 방이 없을 경우 방을 만들고 이미 방이 있을 경우 방에 접속합니다. 물론 사전에 방 이름이 있어야 하겠지만 만약 방 이름이 없을 경우 RemoteMonster는 고유한 방 이름을 생성해서 Observer의 onCreateChannel메소드를 통해 방이름을 반환하게 됩니다.
메소드는 하나이지만 방이름이 이미 존재하는지 여부에 따라 없으면 Observer의 onCreateChannel메소드, 있으면 onConnectChannel 메소드가 호출된다고 보면 되며, onConnectChannel메소드 호출시 상대편과 연결이 완료되었음을 의미합니다.
상대편과 통화 연결에 완전히 성공하는 경우 Observer의 onStateChange의 STATE.COMPLETE 상태가 입력값으로 들어옵니다. 이 때 필요한 서비스를 진행하면 됩니다.// 방을 검색
public void searchChannels(String channelId)


주어진 인자값에 해당하는 방이름이 있는지 검색하여 알려줍니다. 인자값이 없으면 모든 방 정보를 알려줍니다.
검색의 결과는 Observer의 onSearchChannels를 통해서 받을 수 있습니다.public void sendMessage(String msg);


통신 중에 상대방에게 문자 형태의 메시지를 전달합니다. 이 기능을 활용하여 채팅에 활용하거나 내부 로직에 사용할 수 있습니다.
Observer의 onMessage 메소드를 통해서 상대편의 메시지를 수신할 수 있습니다.public void pauseLocalVideo();
public void startLocalVideo();
public void setMicMute(boolean mute);


로컬 영상을 잠시 pause하거나 다시 실행시키는 기능입니다. 아울러 자신의 기기의 마이크를 잠시 꺼두는 기능도 제공합니다.public void switchCamera();


로컬 카메라가 전면과 후면이 있을 경우 이것을 토글시켜서 변경하는 것이 가능합니다.public void close();


Remon을 사용한 이후에는 반드시 close를 해주어야 합니다. 통신에 문제가 생기면 알아서 close가 되기도 하지만 남아있는 자원이 만에 하나 있다면 기기 성능에 아무래도 영향을 미칠 수 있습니다.
재연결이 필요한 경우에도 close를 하고 다시 Remon객체를 생성하는 것을 권합니다.

RemonFactory: 멀티채팅 구현시

여러개의 Remon객체를 생성하여 다중 채널, 멀티 채팅을 구현하고자 한다면 Remonfactory를 사용하여 Remon객체를 생성하기 바랍니다.
RemonFactory는 여러 Remon객체의 자원을 관리하므로 직접 Remon객체를 여러개 만드는 것보다 수월하게 Remon객체의 수명주기를 관리할 수 있습니다.
마찬가지로 개별 Remon객체의 close는 RemonFactory.close 메소드를 활용해야 합니다.

AndroidConfigGuide.html.body:
Android SDK의 Config

RemoteMonster는 객체 생성 전에 config값을 선행적으로 받습니다. 가장 단순하게는Config config = new com.remon.remondroid.Config();
config.setLocalView((SurfaceViewRenderer) findViewById(R.id.local_video_view));
config.setRemoteView((SurfaceViewRenderer) findViewById(R.id.remote_video_view));


와 같이 영상을 출력할 video view를 설정하는 것만으로 RemoteMonster는 잘 알아듣고 config처리를 합니다. 하지만 실제 서비스를 위해서 RemoteMonster는 더 많은 설정값을 요구합니다. 이를테면 서비스 인증을 위한 키값을 요구합니다.Config config = new com.remon.remondroid.Config();
config.setServiceId("simpleapp");
config.setKey("blahblah");


위와 같이 config는 view 항목뿐 아니라 인증값을 요구합니다. 따라서 되도록이면 홈페이지에서 별도의 인증키를 발급받으시는 것을 추천합니다. 이를 통해 더 나은 서비스를 제공받을 수 있습니다.
key는 리모트몬스터로 부터 발급받는 비밀키입니다. serviceId는 여러분이 리모트몬스터에 서비스 가입을 할 때 입력하는 값입니다. 즉 당신의 id값이라고 보면 됩니다.
이제 이 config에 더하여 음성과 영상에 대한 보다 다양한 옵션을 살펴봅시다.config.setVideoCall(true);


영상통신이 필요없고 음성통신만 필요한 경우에는 videoCall항목을 false로 합니다.config.setVideoWidth(640);
config.setVideoHeight(480);


width와 height는 상대편에게 보낼 영상의 해상도를 결정하는 것입니다. 최대 640 480의 해상도로 보낼 것을 설정하였지만 이것이 꼭 지켜지는 것은 아닙니다. WebRTC는 기본적으로 네트워크나 단말의 상태에 따라 해상도와 framerate등을 유연하게 변화시키면서 품질을 유지하고 있기 때문입니다. HD급부터 QQVGA(160x120)급까지 다양한 해상도를 적용할 수 있습니다.config.setVideoCodec("VP8");


영상통신시의 코덱을 결정합니다. H.264와 VP8, VP9등의 영상 코덱을 지원하고 있습니다. RemoteMonster는 H.264를 기본 코덱으로 사용하고 있으며 변경이 필요하다면 이 설정으로 변경할 수 있습니다.config.setVideoFps(15);


frameRate항목은 1초에 몇번의 frame으로 인코딩할 지를 결정합니다. 일반적인 영상통화에서는 15정도면 적당하지만 더 촘촘한 framerate를 원한다면 높여줄 수 있겠죠.config.setLogLevel(Log.DEBUG);


마지막으로 로그레벨 설정입니다. ERROR, WARN, INFO, DEBUG, VERBOSE를 설정할 수 있으며 뒤로 갈 수록 더 자세한 로그를 확인할 수 있습니다.

RemondroidLayout.html.body:
리모트몬스터 안드로이드의 레이아웃과 뷰

리모트몬스터 안드로이드 SDK는 레이아웃과 관련하여 2개의 클래스를 제공하고 있습니다. 가장 핵심이 되는, 영상을 출력하는 View인 org.webrtc.SurfaceViewRender와 이 SurfaceViewRender를 효율적으로 RelativeLayout에서 배치하는데 도움을 주는 PercentFrameLayout으로 이루어져 있습니다. 이 중에서도 SurfaceViewRender가 가장 핵심이므로 먼저 살펴보겠습니다.

SurfaceViewRender

android layout 파일에서 다음과 같이 layout에 배치함으로써 SurfaceViewRender를 사용할 수 있습니다.





그리고 특정 Activity에서 다음과 같이 이 View의 객체를 얻어옵니다.SurfaceViewRender localRender =
  (SurfaceViewRenderer) findViewById(R.id.local_video_view);
SurfaceViewRender remoteRender =
  (SurfaceViewRenderer) findViewById(R.id.remote_video_view);


이제 이 뷰를 사용할 기본 준비가 완료되었습니다.
Remon 클래스의 객체를 생성하고 생성할 때 Config 객체에 이 두 쌍의 뷰를 설정하면 통신이 시작됨과 함께 이 뷰에 카메라나 원격의 영상 스트림이 출력됩니다.
몇가지 이 SurfaceViewRender의 메소드를 살펴보겠습니다.localRender.setZOrderMediaOverlay(true/false);


뷰간의 ZOrder를 설정할 수 있습니다. 즉 이 뷰를 다른 뷰보다 위 위치하도록 설정합니다. 겹치는 뷰가 있을 경우 다른 뷰는 false로 하고 해당 뷰만 true로 설정해야 합니다.localRender.setMirror(false);


해당 뷰의 영상을 거울효과를 주어서 좌우가 바뀌는 방식으로 보여줄 수 있습니다.localRender.setScalingType(RendererCommon.ScalingType);


layout에 어떻게 채울지를 결정합니다.

PercentFrameLayout

리모트몬스터 안드로이드 SDK에서는 영상관련 View의 배치를 쉽게 하기 위해 PercentFrameLayout을 제공합니다. PercentFrameLayout을 이용하면 영상 관련 View를 RelativeLayout안에서 자유롭게 배치하고 동적으로 움직일 수 있습니다.
다음 화면처럼 여러 SurfaceViewRender를 구성하는 것도 가능합니다.

PercentFrameLayout은 layout내의 뷰들을 퍼센트 방식으로 배치합니다. 즉,layout.setPosition(0,0,100,100);


은 해당 레이아웃을 relativeLayout상에서 가로세로 100%채워서 배치하겠다는 것이고layout.setPosition(0,50,50,50);


은 해당 레이아웃을 relativeLayout을 4분면으로 나눠서 좌측 하단에 50%만큼 자리를 차지하겠다는 것입니다.
